🏁 El @baja_manta nos deja con emociones encontradas! Por un lado, estamos muy contentos con la organización. La ruta fue muy entretenida con tramos en los que nuestra Chevrolet Dmax llegaba hasta 160 kmph! Sin embargo perdimos tiempo cuando un fallo eléctrico casi nos deja fuera de la carrera. Al final nuestro piloto @cesar_enriquez_adv y copiloto Thaufik Amador pudieron solucionar el desperfecto y continuamos la ruta. Llegamos al podio pese a todos los obstáculos en 3er Lugar. Gracias a las increíbles personas que nos acompañaron en ésta gran aventura!

Nuestra siguiente carrera será el @baja200imbabura el 2 y 3 de septiembre! Nos vemos en la provincia blanca!

Muchas gracias a nuestros sponsors que nos ayudaron a llegar a nuestro objetivo:

