Kilimanjaro 5895m 🇹🇿 
Grateful for being once again on the roof of Africa for the 13th time with my first wonderful Latin American group from my agency @cumbretours. I love my guiding job and even more so with such great people. Tanzania has become one of my favorite places in the World for its people full of energy, charisma and love for their mountain and the tourists. Kilimanjaro is fascinating for its natural diversity, its people and its postcard sunrises. No doubt mountaineering in Africa makes this 7summit one of the most special! Asante Sana! Thanks to @aktivferien_com for the impeccable logistics always. This is just the start, we continue in this adventure in Africa!

//Kilimanjaro 5895m 🇹🇿 simplemente agradecido de la vida  por haberme permitido una vez más estar en el techo de Africa por 13vq vez, con mi primer grupo latinoamericano maravilloso de mi agencia @cumbretours. Amo mi trabajo de guiar y más aún con gente tan genial. Tanzania se ha vuelto uno de mis lugares favoritos en el Mundo por su gente llena de energía, carisma y amor por su montaña y el turista. El Kilimanjaro es fascinante por su diversidad natural, su gente y  sus amaneceres de postal. Sin duda hacer montaña en África hace de este 7summit uno de los más especiales! Asante Sana 🇹🇿 Gracias a @aktivferien_com por la logística impecable siempre. Esto solo es el gran inicio, seguimos en esta aventura en África!

