Hace casi dos meses tuve la suerte de compartir mi historia en Tulcan!
Fue un evento muy emotivo donde nos atendieron (a mi Tayta @antonio47ec y a mí) con muchísimo cariño!
También hicimos una donación de mi querida Diabla, la handbike que utilice en el ascenso al #kilimanjaro en el 2019. Esta  handbike fue construida por Infufrance @royerepascal , lo cual para mi fue un gran apoyo porque me ayudó mucho a entrenar y disfrutar de la libertad que te da este hermoso deporte.
Pero ya era momento de que otras personas con discapacidad ♿️ la utilicen. Me alegró muchísimo ver esas sonrisas de felicidad y libertad que uno siente cuando te puedes mover con más facilidad!!! Como dice el @richardcarapaz “los sueños están para cumplirse” Y para mi es un gran sueño que más personas con discapacidad puedan disfrutar del deporte!

Muchas gracias @pamerazo23 y por organizar tremendo evento! Y a toda tu familia por tanto cariño! 🥰 Esto es el inicio de mucho!!!
